global
	log /dev/log    local0 info
	maxconn 400000
#	chroot /var/lib/haproxy
#	stats socket /run/haproxy/admin.sock mode 660 level admin process 1
#	stats timeout 30s
#	user haproxy
#	group haproxy
	daemon
	# debug
	# quiet
	ulimit-n 1000000
	# Default SSL material locations
	ca-base /etc/ssl/certs
	crt-base /etc/ssl/private

	# Default ciphers to use on SSL-enabled listening sockets.
	# For more information, see ciphers(1SSL). This list is from:
	#  https://hynek.me/articles/hardening-your-web-servers-ssl-ciphers/
	ssl-default-bind-ciphers ECDH+AESGCM:DH+AESGCM:ECDH+AES256:DH+AES256:ECDH+AES128:DH+AES:ECDH+3DES:DH+3DES:RSA+AESGCM:RSA+AES:RSA+3DES:!aNULL:!MD5:!DSS
	ssl-default-bind-options no-sslv3
	tune.ssl.default-dh-param 4096
	nbproc 16

defaults
	log	global
	mode	http
	option	httplog
	option	dontlognull
	option	redispatch
	retries	3
	maxconn 400000
	timeout connect 5000
	timeout client 50000
	timeout server 50000
	bind-process 1
#	errorfile 400 /etc/haproxy/errors/400.http
#	errorfile 403 /etc/haproxy/errors/403.http
#	errorfile 408 /etc/haproxy/errors/408.http
#	errorfile 500 /etc/haproxy/errors/500.http
#	errorfile 502 /etc/haproxy/errors/502.http
#	errorfile 503 /etc/haproxy/errors/503.http
#	errorfile 504 /etc/haproxy/errors/504.http

listen ssl-indianrummynetwork-com
	bind-process 2 3 4 5 6 7 8
        bind *:80
	#bind 192.168.1.248:443 ssl crt /etc/ssl/private/star-indianrummynetwork-com-stud.pem
	mode tcp
	option tcplog
	server http-01 127.1.1.1:8001 send-proxy
	server http-02 127.1.1.2:8001 send-proxy
	server http-03 127.1.1.3:8001 send-proxy
	server http-04 127.1.1.4:8001 send-proxy
	server http-05 127.1.1.5:8001 send-proxy
	server http-06 127.1.1.6:8001 send-proxy
	maxconn 400000

# indianrummynetwork.com
frontend indianrummynetwork-com
        # Add CORS headers when Origin header is present
        capture request header origin len 128
        acl origin_acl capture.req.hdr(0) -m found
        http-response add-header Access-Control-Allow-Origin %[capture.req.hdr(0)] if origin_acl
        #http-response add-header Access-Control-Allow-Origin %[capture.req.hdr(0)] if !METH_OPTIONS { capture.req.hdr(0) -m reg -f /etc/haproxy/cors-origins.lst }
        rspadd Access-Control-Allow-Methods:\ GET,\ HEAD,\ OPTIONS,\ POST,\ PUT  if origin_acl
        rspadd Access-Control-Allow-Credentials:\ true  if origin_acl
        rspadd Access-Control-Allow-Headers:\ Referer,\ Sec-Fetch-Mode,\ Authorization,\ Accept,\ Origin,\ DNT,\ X-CustomHeader,\ Keep-Alive,\ User-Agent,\ X-Requested-With,\ If-Modified-Since,\ Cache-Control,\ Content-Type,\ Content-Range,\ Range,\ User-Agent,\ Access-Control-Request-Method,\ Access-Control-Request-Headers if origin_acl

	bind-process 1
	bind 127.1.1.1:8001 accept-proxy name irn-frontend-1
	bind 127.1.1.2:8001 accept-proxy name irn-frontend-2
	bind 127.1.1.3:8001 accept-proxy name irn-frontend-3
	bind 127.1.1.4:8001 accept-proxy name irn-frontend-4
	bind 127.1.1.5:8001 accept-proxy name irn-frontend-5
	bind 127.1.1.6:8001 accept-proxy name irn-frontend-6

	# force closing of connection on the server side after one request is
	# served. otherwise only the first request of a http/1.1 session will
	# be analyzed by the following rules.
	option logasap
	option forceclose
	option forwardfor

	default_backend games-indianrummynetwork-com-backend

	#
	# html lobby frontend
	#
	#acl html-lobby-frontend-path-acl path_beg /html-lobby
	#use_backend html-lobby-frontend if html-lobby-frontend-path-acl

