	#acl demo-lobby-frontend-path-acl path_beg /demo-lobby
	#use_backend demo-lobby-frontend if demo-lobby-frontend-path-acl

	#
	# games.indianrummynetwork.com
	#
	acl games-indianrummynetwork-com-acl hdr_reg(host) -i ^(preprod-kub-)?g(ames)?.indianrummynetwork.com(:443)?$
	acl game-path-acl path_reg ^/game/

	# lobby
	acl lobby-path-acl url_reg -- (&|\?)target=lobby(&|$)

